<p class="" data-start="327" data-end="560"><strong data-start="327" data-end="346">Desa Sukolilo &mdash;</strong> Dalam upaya meningkatkan kesadaran masyarakat terhadap bahaya narkoba, Pemerintah Desa Sukolilo mengadakan kegiatan <strong data-start="463" data-end="505">Penyuluhan Program Bersih dari Narkoba</strong> pada Senin, 25 November 2024, bertempat di balai desa.</p>
<p class="" data-start="562" data-end="827">Kegiatan ini menghadirkan narasumber dari Badan Narkotika Nasional Kabupaten Madiun (BNNK), perwakilan dari Kepolisian Sektor Jiwan, serta tokoh masyarakat. Penyuluhan menyasar berbagai elemen masyarakat, termasuk pemuda, pelajar, ibu rumah tangga, dan tokoh agama.</p>
<p class="" data-start="829" data-end="1054">Dalam pemaparannya, narasumber menjelaskan tentang jenis-jenis narkoba, dampak penyalahgunaan terhadap kesehatan dan masa depan generasi muda, serta cara mengenali dan melaporkan indikasi penyalahgunaan di lingkungan sekitar.</p>
<blockquote data-start="1056" data-end="1289">
<p class="" data-start="1058" data-end="1289"><em data-start="1058" data-end="1249">"Mencegah lebih baik daripada mengobati. Penyuluhan seperti ini sangat penting agar masyarakat tidak hanya tahu bahaya narkoba, tetapi juga paham bagaimana mencegah dan melawannya bersama,"</em> ungkap salah satu narasumber dari BNNK.</p>
</blockquote>
<p class="" data-start="1291" data-end="1548">Acara berlangsung interaktif, dengan sesi tanya jawab yang dimanfaatkan peserta untuk menggali informasi lebih dalam. Pemerintah Desa juga berkomitmen menjadikan program ini sebagai agenda rutin dalam rangka menciptakan <strong data-start="1511" data-end="1528">Desa Bersinar</strong> (<em data-start="1530" data-end="1546">Bersih Narkoba</em>).</p>
<p class="" data-start="1550" data-end="1737">Kepala Desa Sukolilo berharap kegiatan ini menjadi langkah awal membangun lingkungan yang sehat, aman, dan terbebas dari ancaman narkoba, terutama bagi generasi muda sebagai penerus desa.</p>, 1, , 2024-11-11 15:28:56, ?, agenda, 1, desa-sukolilo-gelar-penyuluhan-program-bersih-dari-narkoba-cegah-sejak-dini-selamatkan-generasi, 1))
